const aCharCode = 97;
const zCharCode = 122;
const asciiLowerUpperDiff = 32;

/**
 * Check if char a is Uppercase of char b or vice versa
 * @param {string} a 
 * @param {string} b 
 */
function isPolarizing(a, b) {
    return Math.abs(a.charCodeAt() - b.charCodeAt()) === asciiLowerUpperDiff;
}

function reduceOnce(input) {
    if (input.length <= 1) {
        return input;
    }

    for (let i = 1; i < input.length; i++) {
        if (isPolarizing(input[i -1], input[i])) {
            input.splice(i -1, 2);
            return true;
        }
    }

    return false;
}

/**
 * 
 * @param {string} input 
 */
function part1(input) {
    let inputChars = input.split("");

    while(reduceOnce(inputChars)) {}

    return inputChars.length;
}

/**
 * 
 * @param {string} input 
 */
function part2(input) {
    let minLength = -1;

    for (let charCode = aCharCode; charCode <= zCharCode; charCode++) {
        let inputChars = input.split("");
        let currentChar = String.fromCharCode(charCode);
        let filteredChars = inputChars
            .filter((c) => c.toLowerCase() !== currentChar);
        
        while(reduceOnce(filteredChars)) {}

        let filteredLength = filteredChars.length;
        if (filteredLength < minLength || minLength === -1) {
            minLength = filteredLength;
        }
    }

    return minLength;
}


let input = "";

let part1Result = part1(input);

console.log(part1Result);

let part2Result = part2(input);

console.log(part2Result);
